import React from 'react';

import './Customer.css';

import { API } from '../../AxiosConfig';




const Customer = () => {
	http: return (
		<section>
			<div className='how'>
				{users.map((user) => (
					<div className='data'>
						<div>Id: {user.id}</div>
						<div>Ten: {user.name}</div>
						<div>SDT: {user.phoneNumber}</div>
					</div>
				))}
			</div>
		</section>
	);
};

export default Customer;
